// import ExpenseItem from "./Components/ExpenseItem";
import Expenses from "./Components/Expenses";

function App() {
  const expense = [
    {
      id: 1,
      title: "Toilet Paper",
      amount: 12,
      date: new Date(2022, 5, 1),
    },
    {
      id: 2,
      title: "Car Insurance",
      amount: 3000,
      date: new Date(2022, 5, 10),
    },
    {
      id: 3,
      title: "New TV",
      amount: 120,
      date: new Date(2022, 5, 15),
    },
    {
      id: 4,
      title: "New desk",
      amount: 500,
      date: new Date(2022, 5, 25),
    },
  ];
  return (
    <div>
      <Expenses />
    </div>
  );
}

export default App;
